package ab51;

public class ifelseifblock 
{

	public static void main(String[] args) 
	{
		
		// TODO Auto-generated method stub
       // Only 1st true result will execute. Other than nothing will execute.	
		
	 int a=30;
	 int b=30;

	if(a>b)	
	{
		System.out.println("1");
	}
	else if(a<=b)
	{
		System.out.println("2");
	}
	else
	{
		System.out.println("3");
	}
		
	}
}

// Note: only 1st true condition will showing results. Other than nothing.

